import React from 'react';
import { Outlet } from 'react-router-dom';
import Footer from '../Footer/Footer';
import Navbar from '../Navbar/Navbar';

const Root_layout = () => {
  return (
    <div className='h-screen'>
       <Navbar/>
        <Outlet />
        <Footer/>
        
    </div>
  )
}

export default Root_layout
